import ResponseQuestions from './ResponseElements/ResponseQuestions';
import { type } from '@testing-library/user-event/dist/type';
var retrievedData;
var rawQuestions = [];

  useEffect(()=> {
    axios.get('http://localhost:3001/api/get').then((response) => {
      retrievedData = response.data;
      console.log(retrievedData); // Log the entire response data to see its structure
      console.log(retrievedData[0].questions)
      //console.log(retrievedData[0].questions)
      rawQuestions = JSON.parse(retrievedData[0].questions);
      console.log('questions:')
      console.log(rawQuestions[0].id);
